package main

import "fmt"

func main() {
	fmt.Println(makeFancyString(""))
}

func makeFancyString(s string) string {
	var result []byte
	count := 1

	for i := 0; i < len(s); i++ {
		if i == 0 {
			result = append(result, s[i])
			continue
		}

		if s[i] == s[i-1] {
			count++
		} else {
			count = 1
		}

		if count <= 2 {
			result = append(result, s[i])
		}
	}

	return string(result)
}
